      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "u2kIgtROppubHJ4SkXVC8AdYBK8",
          "id": "UgwzmXRHeBMurLMZYi14AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "I really have an idea about this. But It&#39;s so hard to explain because it&#39;s also hard to find the right words as well, just to be able for you to fully understand.\u003cbr\u003e\u003cbr\u003eIdea:\u003cbr\u003eWhile you&#39;re spaceship is moving from Earth to Mars, the time you see on Mars becames faster and the time you see from Earth becames slower.\u003cbr\u003eThat&#39;s because you receive light from Mars faster than Earth.\u003cbr\u003e\u003cbr\u003eThe time from Earth become slower because your spaceship goes away from the Earth&#39;s light, making you receive light from Earth slower.\u003cbr\u003e\u003cbr\u003eThe time from Mars became faster because your spaceship is moving towards Mars and it&#39;s light, making you receive light from Mars faster.\u003cbr\u003e\u003cbr\u003eThose two things will happen at the same time as your spaceship moves. But if your spaceship stops moving, the speed of time you saw from these planets will go back to normal.\u003cbr\u003e\u003cbr\u003eBut, when you land on Mars, you can only see the Earth what it was minutes ago, not the actual time on Earth. You are seeing the exact present time on Mars but delayed time from Earth.\u003cbr\u003e\u003cbr\u003eIt&#39;s the same about the Sun and Earth, or the stars light years away.\u003cbr\u003e\u003cbr\u003eThe sunlight travels 8 minutes to reach Earth. So you&#39;re seeing what the Sun was 8 minutes ago.\u003cbr\u003e\u003cbr\u003eIf the star is a light year from Earth, you&#39;re seeing what that star was a year ago.\u003cbr\u003e\u003cbr\u003eYou are seeing the past of these objects, not the exact present.\u003cbr\u003e\u003cbr\u003eMaybe because of this, we can&#39;t find some signs of life yet in the outer space.",
            "textOriginal": "I really have an idea about this. But It's so hard to explain because it's also hard to find the right words as well, just to be able for you to fully understand.\n\nIdea:\nWhile you're spaceship is moving from Earth to Mars, the time you see on Mars becames faster and the time you see from Earth becames slower.\nThat's because you receive light from Mars faster than Earth.\n\nThe time from Earth become slower because your spaceship goes away from the Earth's light, making you receive light from Earth slower.\n\nThe time from Mars became faster because your spaceship is moving towards Mars and it's light, making you receive light from Mars faster.\n\nThose two things will happen at the same time as your spaceship moves. But if your spaceship stops moving, the speed of time you saw from these planets will go back to normal.\n\nBut, when you land on Mars, you can only see the Earth what it was minutes ago, not the actual time on Earth. You are seeing the exact present time on Mars but delayed time from Earth.\n\nIt's the same about the Sun and Earth, or the stars light years away.\n\nThe sunlight travels 8 minutes to reach Earth. So you're seeing what the Sun was 8 minutes ago.\n\nIf the star is a light year from Earth, you're seeing what that star was a year ago.\n\nYou are seeing the past of these objects, not the exact present.\n\nMaybe because of this, we can't find some signs of life yet in the outer space.",
            "authorDisplayName": "TheEarlyAstrotype",
            "authorProfileImageUrl": "https://yt3.ggpht.com/AQv1BMfichjVvVpGhFRWdY8wIATu_pfhcqxZfyyNmG-lqnMO5fRDapdYtkkakqkuIZrX-4Lr_18=s48-c-k-c0x00ffffff-no-rj",
