      "replies": {
        "comments": [
          {
            "kind": "youtube#comment",
            "etag": "yCWGL1lmHvBIgMy-o0JKDJMIByM",
            "id": "UgwzmXRHeBMurLMZYi14AaABAg.9HJlbHLPokj9HWaF9v167l",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "You are confusing &quot;seeing&quot; clocks run slower to clocks running slower. What you are describing is &quot;seeing&quot; clocks run slower/faster, due to time delay of light propagation. But that can always be adjusted for because you know the time delay, so you can add / subtract to know the rate at which clocks are running . Once this adjustment has been done, the final result shows both the Earth and Mars clock are running slower, in that example of travelling from  Earth to Mars. That is the time dilation effect .",
              "textOriginal": "You are confusing \"seeing\" clocks run slower to clocks running slower. What you are describing is \"seeing\" clocks run slower/faster, due to time delay of light propagation. But that can always be adjusted for because you know the time delay, so you can add / subtract to know the rate at which clocks are running . Once this adjustment has been done, the final result shows both the Earth and Mars clock are running slower, in that example of travelling from  Earth to Mars. That is the time dilation effect .",
