          "kind": "youtube#comment",
          "etag": "ZYPuXVV0GC93t9bJdgZGo4uGxes",
          "id": "Ugyphjg9VGqmX9apru14AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "\u003ca href=\"https://www.youtube.com/watch?v=yuD34tEpRFw&amp;t=3m15s\"\u003e3:15\u003c/a\u003e if einstein and the train passenger are both facing eachother when the lightning strikes, and the train is moving at the speed of light, is it not true that the train passenger would never see the lightning behind the train? this is a poor representation of einsteins train. of course someone will see the lightning strike they are closest to, but this has nothing to do with relativity and ignores the fact that the train is moving. you have mixed two of his theories into one, which makes no sense. \u003cbr\u003e\u003cbr\u003e\u003cbr\u003efirst off, the train isn&#39;t moving at the speed of light, that just breaks the experiment. just the fact that it is moving is sufficient. because it is moving, the passenger sees the lightning strike at the front end of the train first, as the light is moving towards him, and he is moving towards it. then, moments later, he sees the strike at the back of the train, because as the light moves towards him, he is moving away from it. whereas the man on the platform sees them both hit at the same time. this alone doesn&#39;t break any natural laws as you wildly suggest. and then you start talking about time dilation, without linking the two ideas in any way.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003ethe experiment that you are actually talking about is one in which a beam of light is following alongside the train. the observer on the platform would observe the beams speed as x, while the observer on the train would measure the beam of light as x - the speed of the train. This discrepancy makes sense to the platform observer, because he understands that the train is moving. but he doesn&#39;t consider that he is also moving, which makes his measurement only true relative to his velocity. again, there is no link here to time dilation due to bending of space time. you have failed to even explain this in simple terms. thanks.",
            "textOriginal": "3:15 if einstein and the train passenger are both facing eachother when the lightning strikes, and the train is moving at the speed of light, is it not true that the train passenger would never see the lightning behind the train? this is a poor representation of einsteins train. of course someone will see the lightning strike they are closest to, but this has nothing to do with relativity and ignores the fact that the train is moving. you have mixed two of his theories into one, which makes no sense. \n\n\nfirst off, the train isn't moving at the speed of light, that just breaks the experiment. just the fact that it is moving is sufficient. because it is moving, the passenger sees the lightning strike at the front end of the train first, as the light is moving towards him, and he is moving towards it. then, moments later, he sees the strike at the back of the train, because as the light moves towards him, he is moving away from it. whereas the man on the platform sees them both hit at the same time. this alone doesn't break any natural laws as you wildly suggest. and then you start talking about time dilation, without linking the two ideas in any way.\n\n\nthe experiment that you are actually talking about is one in which a beam of light is following alongside the train. the observer on the platform would observe the beams speed as x, while the observer on the train would measure the beam of light as x - the speed of the train. This discrepancy makes sense to the platform observer, because he understands that the train is moving. but he doesn't consider that he is also moving, which makes his measurement only true relative to his velocity. again, there is no link here to time dilation due to bending of space time. you have failed to even explain this in simple terms. thanks.",
